  - name: TEXT4000
    number: '6'
    value: 'We have responded fully to all 22 items on a Form 99 that was filed. However,
      certain items that were addressed on the Form 99 are also being addressed via
      this memo text.    The amounts received from the Republican Party of Los Angeles
      County are payments for rent. The amount received from San Diego County is a
      refund of amounts paid to them for a paid walk program. The original check was
      dated 10/28/2010. No transfer is needed from the Federal account to the Levin
      account as the committee initially had not fully transferred eligible Levin
      funds to their Federal account. Please note our software does not allow us to
      put the description directly on line 15.    The actual debt owed to 1-800 Conference
      was only $113.62. The debt was initially overstated back in June of 2009. We
      have clarified this report to reflect the unaccounted $364.66. The zero ending
      balance is correct. Note, this was not a debt forgiveness but simply the correction
      of a minor clerical input error from 2009.    The payment to Chuck Hahn was
      paid on 9/20/10. While we realize that the above payments and the payments to
      Eric Beach & Dynamic Vision were made in earlier months, we ask for your understanding
      in not making us re-run  the last two or three  reports filed. Due to the time
      of year ( i.e. election mode and the amount of monies flowing through this entity)
      several debt  payments were not reflected as being paid in the actual month
      that they were paid.    As we have discussed informally on the phone in the
      past; the committee has several persons and now two caging companies that have
      access to Aristotle (our software company). It is very likely that if we go
      back three reports our cash or our sub-totals between lines could have changed
      by immaterial amounts. (i.e. less than $ 75). It would take massive amounts
      of manpower to figure out what caused a hypothetical $75 change.  The committee
      on this and the year-end efforts made a concerted effort to make sure the debt
      reflected at the end of this report and the year-end was correct. We ask for
      your understanding of why these debt changes were reflected on this report instead
      of earlier reports.    Item 14 on your inquiry  Both these items should have
      been reported on 30(b). The GOTV management is a fee paid to oversee a paid
      walk program. The other sd walkers was referencing a paid walk program in San
      Diego. We will make a corrective transfer of $4411.32 in the next few days.
      Please note we are making this corrective transfer as a show of good faith.
      We believe the committee had not transferred all its allocable expenses form
      the non-federal to the federal account during the applicable seventy day window.    Item
      18 on your inquiry  This was a payment for catering for various staff lunches
      & staff meetings where overall political strategies and debating what involvement
      if any the campaign would have with the Harmer race. We apologize for the unclear
      description and have corrected the description on our amended report.  '
